# --- helper to map yes/no into 0/1 when a column is textual ------------------
def _map_binary(series: pd.Series) -> pd.Series:
    lower = series.astype(str).str.lower()
    if set(lower.unique()) <= {"yes", "no"}:
        return lower.map({"no": 0, "yes": 1}).astype("int64")
    return series

